export default function Login() {
  return (
    <div className="card">
      <div className="card-body">
        <h5 className="card-title"> LOGIN </h5>
        <p className="card-text"> Login to your account</p>
        <form>
          <div className="mb-3">
              Email address
            <input>placeholder= "Username"</input>
            </div>
            </form>
          </div>

    </div>
  );
}
